import React from 'react';
import LazyLoad from 'react-lazyload';

const PhotoListDetail = ({ urls, description }) => {
	const placeholderImg = 'https://via.placeholder.com/400x200.png?text=This+Will+Be+Shown+Before+Load';

	const renderDetail = () => {
		return (
			<div>
				<img src={urls ? urls : placeholderImg} alt={description} style={{ width: '500px', height: 'auto' }} />
			</div>
		);
	};

	if (urls) {
		return renderDetail();
	} else {
		return <span>No images yet</span>;
	}
};

export default PhotoListDetail;
